import "./TodoHomePage.css";
export default function TodoHomePage() {
  return (
    <div>
     <header>
      <h1 className="todo-title">My Todo App</h1>
      <nav className="todo-nav">
        <h3>List All Todos</h3>
        <h3>Show Pending Todos</h3>
        <h3>Show Completed Todos</h3>
      </nav>
     </header>
    </div>
  )
}
